import React, {useState} from 'react';
import {Carousel, Navbar, Container, Nav} from "react-bootstrap";
import a from "./img/a.jpg";
import b from "./img/b.jpg";
import c from "./img/c.jpg";

function Banner(props){
    return (
      <div>
        <img src={props.image} alt="img" height= "600" width="100%" />

      </div>
    )
}

const Cover = () => {

    const [index, setIndex] = useState(0);

    const handleSelect = (selectedIndex, e) => {
        setIndex(selectedIndex);
    };

    return (

        <Carousel activeIndex={index} onSelect={handleSelect}>

<Navbar expand="sm" style={{background:"black"}}>
  <Container>
    <Navbar.Brand href="#">Quoto</Navbar.Brand>
    <Navbar.Toggle aria-controls="navbarScroll" />
    <Navbar.Collapse id="navbarScroll">
      <Nav
        className="me-auto my-2 my-lg-0"
        style={{ maxHeight: '100px' }}
        navbarScroll
      >
        <Nav.Link href="#action1">Home</Nav.Link>
        <Nav.Link href="#action2">Features</Nav.Link>
        <Nav.Link href="#action1">About Us</Nav.Link>
        <Nav.Link href="#action1">Portfolio</Nav.Link>
        <Nav.Link href="#action2">Contact Us</Nav.Link>
      </Nav>
    </Navbar.Collapse>
  </Container>
</Navbar>
      <Carousel.Item>
        <Banner image={a} />
        <Carousel.Caption>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <Banner image={b}/>

        <Carousel.Caption>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <Banner image={c}/>

        <Carousel.Caption>

          <p>
            Praesent commodo cursus magna, vel scelerisque nisl consectetur.
          </p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>

    )
}

export default Cover;
